function sum(n){let r=0;for(i=0;i<n.length;i++)r+=n[i];return r}function odd(n){return n%2==0}function even(n){return n%2!=0}function sumToN(n){let r=0,t=1;for(;t<=n;)r+=t,t++;return r}function sumXToY(n,r){let t=0;for(;n<=r;)t+=n,n++;return t}function lcm(n,r){let t=0,i=1;for(;;){if(i%n==0&&i%r==0){t=i;break}i++}return t}function gcd(n,r){let t=1;for(let i=1;i<=n;i++)n%i==0&&r%i==0&&(t=i);return t}function rndI(n,r){return Math.floor(Math.random()*(r+1))+n}function rnd(n,r){return Math.random()*(r+1)+n}function round(n){return Math.round(n)}function floor(n){return Math.floor(n)}function toFix(n,r){return Number(n.toFixed(r))}const PI=Math.PI;function square(n){return Math.pow(n,2)}function sqrt(n){return Math.sqrt(n)}function pow(n,r){return Math.pow(n,r)}function divisible(n,r){return n%r==0}function prime(n){for(i=2;i<n;i++)if(n%i==0)return!1;return!0}function max(n){var r=n[0];for(i=1;i<n.length;i++)r<n[i]&&(r=n[i]);return r}function min(n){var r=n[0];for(i=1;i<n.length;i++)r>n[i]&&(r=n[i]);return r}function sin(n){return Math.sin(n)}function abs(n){return Math.abs(n)}function isFin(n){return n==1/0||Number.isNaN(n)}function isNaN(n){return n==Number.isNaN(n)}function cos(n){return Math.cos(n)}function tan(n){return Math.tan(n)}function findPrime(n,r){let t,u=[];for(i=n;i<=r;i++){for(t=!0,j=2;j<i;j++)i%j==0&&(t=!1);0!=t&&i>2&&u.push(i)}return u}function perfectN(n){let r=0;for(i=1;i<n;i++)n%i==0&&n!=i&&(r+=i);return r==n}